\" size=\"2\">Bradykinin                          stimulates further synthesis/release of prostaglandins,                          and, together with the prostaglandins, sensitizes the                          primary afferent sensory fibers in response to stimulation                          by ATP, acetylcholine, serotonin and mechanical and thermal                          stimuli <font size=\"-2\">1,2,3</font></font></li><li> <font face=\"Verdana, Arial, Helvetica, sans-serif\" size=\"2\">Substance                          P and CGRP released by the primary afferent sensory fibers                          contribute to the pain response by triggering the release                          of histamine from mast cells which, in turn, excites the                          peripheral afferent sensory fibers <font size=\"-2\">1,2,3                          </font></font></li><li><font face=\"Verdana, Arial, Helvetica, sans-serif\" size=\"2\">&quot;                          Sensitization of the primary afferent sensory fibers by                          mediators of the pain response results in greater, more                          frequent transmission of action potentials to the nociceptive                          neurons than in &#39;normal&#39; pain responses <font size=\"-2\">1,2,5                          </font></font></li></ul>\nproject_id: \n- \n- 4\nupdated_at: \n- \n- &id001 2007-04-25 11:45:45.580395 Z\ntitle: \n- \n- Peripheral senstization\nupdated_by_user_id: \n- 1\n- 3\nid: \n- \n- 20\ncreated_by_user_id: \n- 1\n- 3\ncreated_at: \n- \n- *id001\n','2007-04-25 11:45:45'),(65,91,'ProjectElement',3,NULL,NULL,'create','--- \nname: \n- \"\"\n- ps-1\nproject_id: \n- \n- 4\nupdated_at: \n- \n- &id001 2007-04-25 11:45:45.894153 Z\nupdated_by_user_id: \n- 1\n- 3\nid: \n- \n- 91\nreference_type: \n- \n- ProjectContent\nreference_id: \n- \n- 20\ncreated_by_user_id: \n- 1\n- 3\nposition: \n- 1\n- 4\nparent_id: \n- \n- 86\npath: \n- \"\"\n- AssayDev/Slides/ps-1\ncreated_at: \n- \n- *id001\n','2007-04-25 11:45:45'),(66,21,'ProjectContent',3,NULL,NULL,'create','--- \nname: \n- \n- h1\nbody_html: \n- \n- \"\"\nproject_id: \n- \n- 4\nupdated_at: \n- \n- &id001 2007-04-25 11:46:15.239775 Z\ntitle: \n- \n- Hyperexitation\nupdated_by_user_id: \n- 1\n- 3\nid: \n- \n- 21\ncreated_by_user_id: \n- 1\n- 3\ncreated_at: \n- \n- *id001\n','2007-04-25 11:46:15'),(67,92,'ProjectElement',3,NULL,NULL,'create','--- \nname: \n- \"\"\n- h1\nproject_id: \n- \n- 4\nupdated_at: \n- \n- &id001 2007-04-25 11:46:15.545277 Z\nupdated_by_user_id: \n- 1\n- 3\nid: \n- \n- 92\nreference_type: \n- \n- ProjectContent\nreference_id: \n- \n- 21\ncreated_by_user_id: \n- 1\n- 3\nposition: \n- 1\n- 5\nparent_id: \n- \n- 86\npath: \n- \"\"\n- AssayDev/Slides/h1\ncreated_at: \n- \n- *id001\n','2007-04-25 11:46:15'),(68,22,'ProjectContent',3,NULL,NULL,'create','--- \nname: \n- \n- pain-1\nbody_html: \n- \n- \"<font face=\\\"Verdana, Arial, Helvetica, sans-serif\\\" size=\\\"2\\\"><strong>Nociceptive pain</strong></font>                     <p><font face=\\\"Verdana, Arial, Helvetica, sans-serif\\\"><strong><font size=\\\"2\\\">Allodynia</font></strong></font></p>                     <ul><li><font face=\\\"Verdana, Arial, Helvetica, sans-serif\\\" size=\\\"2\\\">                          Tissue injury often results in nociceptive pain, in which                          persistent pain is felt in response to direct activation                          of peripheral nerve terminals in the skin by pain response                          mediators from the damaged tissue<font size=\\\"-2\\\"> 1,2                          </font></font></li><li><font face=\\\"Verdana, Arial, Helvetica, sans-serif\\\" size=\\\"2\\\">                          Nociceptive pain: Following tissue injury, Substance P,                          CGRP and glutamate are released by peripheral afferent                          sensory fibers and act on peptide and glutamate receptors                          on the post-synaptic membrane to cause greater excitability                          of nociceptive neurons. Nociceptive neurons become hyperexcitable,                          resulting in central sensitization and thus greater perception                          of pain in the higher centers <font size=\\\"-2\\\">1,2,3</font></font></li><li><font face=\\\"Verdana, Arial, Helvetica, sans-serif\\\" size=\\\"2\\\">                          Nociceptive pain may involve the abnormal pain states                          of allodynia or hyperalgesia which result from both peripheral                          and central hypersensitivity <font size=\\\"-2\\\">1,2,3</font></font></li><li><font face=\\\"Verdana, Arial, Helvetica, sans-serif\\\" size=\\\"2\\\">                          Allodynia: Certain types of noxious stimulus (e.g. sunburn,                          injury, post-surgical wounds) may result in the individual                          perceiving pain in response to stimuli that are not normally                          painful, such as a light stroking of the skin<font size=\\\"-3\\\">                          1,2,4 </font></font></li></ul>\"\nproject_id: \n- \n- 4\nupdated_at: \n- \n- &id001 2007-04-25 11:47:04.401902 Z\ntitle: \n- \n- Nociceptive pain\nupdated_by_user_id: \n- 1\n- 3\nid: \n- \n- 22\ncreated_by_user_id: \n- 1\n- 3\ncreated_at: \n- \n- *id001\n','2007-04-25 11:47:04'),(69,93,'ProjectElement',3,NULL,NULL,'create','--- \nname: \n- \"\"\n- pain-1\nproject_id: \n- \n- 4\nupdated_at: \n- \n- &id001 2007-04-25 11:47:04.497875 Z\nupdated_by_user_id: \n- 1\n- 3\nid: \n- \n- 93\nreference_type: \n- \n- ProjectContent\nreference_id: \n- \n- 22\ncreated_by_user_id: \n- 1\n- 3\nposition: \n- 1\n- 6\nparent_id: \n- \n- 86\npath: \n- \"\"\n- AssayDev/Slides/pain-1\ncreated_at: \n- \n- *id001\n','2007-04-25 11:47:04'),(70,23,'ProjectContent',3,NULL,NULL,'create','--- \nname: \n- \n- pain-2\nbody_html: \n- \n- \"\"\nproject_id: \n- \n- 4\nupdated_at: \n- \n- &id001 2007-04-25 11:47:39.488610 Z\ntitle: \n- \n- Nueropathic Pain\nupdated_by_user_id: \n- 1\n- 3\nid: \n- \n- 23\ncreated_by_user_id: \n- 1\n- 3\ncreated_at: \n- \n- *id001\n','2007-04-25 11:47:39'),(71,94,'ProjectElement',3,NULL,NULL,'create','--- \nname: \n- \"\"\n- pain-2\nproject_id: \n- \n- 4\nupdated_at: \n- \n- &id001 2007-04-25 11:47:39.560913 Z\nupdated_by_user_id: \n- 1\n- 3\nid: \n- \n- 94\nreference_type: \n- \n- ProjectContent\nreference_id: \n- \n- 23\ncreated_by_user_id: \n- 1\n- 3\nposition: \n- 1\n- 7\nparent_id: \n- \n- 86\npath: \n- \"\"\n- AssayDev/Slides/pain-2\ncreated_at: \n- \n- *id001\n','2007-04-25 11:47:39'),(72,24,'ProjectContent',3,NULL,NULL,'create','--- \nname: \n- \n- paf-1\nbody_html: \n- \n- <font face=\"Verdana, Arial, Helvetica, sans-serif\" size=\"2\">During                          wind up, the peripheral afferent sensory fibers fire repeatedly,                          there is increased transmitter release into the spinal                          cord, and the response by spinal cord neurons increases                          progressively <font size=\"-2\">1,3,4</font></font>\nproject_id: \n- \n- 4\nupdated_at: \n- \n- &id001 2007-04-25 11:48:23.687072 Z\ntitle: \n- \n- Repeated firing of PAF\'s\nupdated_by_user_id: \n- 1\n- 3\nid: \n- \n- 24\ncreated_by_user_id: \n- 1\n- 3\ncreated_at: \n- \n- *id001\n','2007-04-25 11:48:23'),(73,95,'ProjectElement',3,NULL,NULL,'create','--- \nname: \n- \"\"\n- paf-1\nproject_id: \n- \n- 4\nupdated_at: \n- \n- &id001 2007-04-25 11:48:24.012695 Z\nupdated_by_user_id: \n- 1\n- 3\nid: \n- \n- 95\nreference_type: \n- \n- ProjectContent\nreference_id: \n- \n- 24\ncreated_by_user_id: \n- 1\n- 3\nposition: \n- 1\n- 8\nparent_id: \n- \n- 86\npath: \n- \"\"\n- AssayDev/Slides/paf-1\ncreated_at: \n- \n- *id001\n','2007-04-25 11:48:24'),(74,25,'ProjectContent',3,NULL,NULL,'create','--- \nname: \n- \n- ion-1\nbody_html: \n- \n- \"\"\nproject_id: \n- \n- 4\nupdated_at: \n- \n- &id001 2007-04-25 11:48:55.931103 Z\ntitle: \n- \n- Ion channels\nupdated_by_user_id: \n- 1\n- 3\nid: \n- \n- 25\ncreated_by_user_id: \n- 1\n- 3\ncreated_at: \n- \n- *id001\n','2007-04-25 11:48:55'),(75,96,'ProjectElement',3,NULL,NULL,'create','--- \nname: \n- \"\"\n- ion-1\nproject_id: \n- \n- 4\nupdated_at: \n- \n- &id001 2007-04-25 11:48:56.018969 Z\nupdated_by_user_id: \n- 1\n- 3\nid: \n- \n- 96\nreference_type: \n- \n- ProjectContent\nreference_id: \n- \n- 25\ncreated_by_user_id: \n- 1\n- 3\nposition: \n- 1\n- 9\nparent_id: \n- \n- 86\npath: \n- \"\"\n- AssayDev/Slides/ion-1\ncreated_at: \n- \n- *id001\n','2007-04-25 11:48:56'),(76,22,'ProjectContent',3,NULL,NULL,'update','--- \nbody_html: \n- \"<font face=\\\"Verdana, Arial, Helvetica, sans-serif\\\" size=\\\"2\\\"><strong>Nociceptive pain</strong></font>                     <p><font face=\\\"Verdana, Arial, Helvetica, sans-serif\\\"><strong><font size=\\\"2\\\">Allodynia</font></strong></font></p>                     <ul><li><font face=\\\"Verdana, Arial, Helvetica, sans-serif\\\" size=\\\"2\\\">                          Tissue injury often results in nociceptive pain, in which                          persistent pain is felt in response to direct activation                          of peripheral nerve terminals in the skin by pain response                          mediators from the damaged tissue<font size=\\\"-2\\\"> 1,2                          </font></font></li><li><font face=\\\"Verdana, Arial, Helvetica, sans-serif\\\" size=\\\"2\\\">                          Nociceptive pain: Following tissue injury, Substance P,                          CGRP and glutamate are released by peripheral afferent                          sensory fibers and act on peptide and glutamate receptors                          on the post-synaptic membrane to cause greater excitability                          of nociceptive neurons. Nociceptive neurons become hyperexcitable,                          resulting in central sensitization and thus greater perception                          of pain in the higher centers <font size=\\\"-2\\\">1,2,3</font></font></li><li><font face=\\\"Verdana, Arial, Helvetica, sans-serif\\\" size=\\\"2\\\">                          Nociceptive pain may involve the abnormal pain states                          of allodynia or hyperalgesia which result from both peripheral                          and central hypersensitivity <font size=\\\"-2\\\">1,2,3</font></font></li><li><font face=\\\"Verdana, Arial, Helvetica, sans-serif\\\" size=\\\"2\\\">                          Allodynia: Certain types of noxious stimulus (e.g. sunburn,                          injury, post-surgical wounds) may result in the individual                          perceiving pain in response to stimuli that are not normally                          painful, such as a light stroking of the skin<font size=\\\"-3\\\">                          1,2,4 </font></font></li></ul>\"\n- \"<font face=\\\"Verdana, Arial, Helvetica, sans-serif\\\"><strong><font size=\\\"2\\\">Allodynia</font></strong></font>                     <ul><li><font face=\\\"Verdana, Arial, Helvetica, sans-serif\\\" size=\\\"2\\\">                          Tissue injury often results in nociceptive pain, in which                          persistent pain is felt in response to direct activation                          of peripheral nerve terminals in the skin by pain response                          mediators from the damaged tissue<font size=\\\"-2\\\"> 1,2                          </font></font></li><li><font face=\\\"Verdana, Arial, Helvetica, sans-serif\\\" size=\\\"2\\\">                          Nociceptive pain: Following tissue injury, Substance P,                          CGRP and glutamate are released by peripheral afferent                          sensory fibers and act on peptide and glutamate receptors                          on the post-synaptic membrane to cause greater excitability                          of nociceptive neurons. Nociceptive neurons become hyperexcitable,                          resulting in central sensitization and thus greater perception                          of pain in the higher centers <font size=\\\"-2\\\">1,2,3</font></font></li><li><font face=\\\"Verdana, Arial, Helvetica, sans-serif\\\" size=\\\"2\\\">                          Nociceptive pain may involve the abnormal pain states                          of allodynia or hyperalgesia which result from both peripheral                          and central hypersensitivity <font size=\\\"-2\\\">1,2,3</font></font></li><li><font face=\\\"Verdana, Arial, Helvetica, sans-serif\\\" size=\\\"2\\\">                          Allodynia: Certain types of noxious stimulus (e.g. sunburn,                          injury, post-surgical wounds) may result in the individual                          perceiving pain in response to stimuli that are not normally                          painful, such as a light stroking of the skin<font size=\\\"-3\\\">                          1,2,4 </font></font></li></ul>\"\nupdated_at: \n- 2007-04-25 11:47:04 Z\n- 2007-04-25 11:49:29.749930 Z\nlock_version: \n- 0\n- 1\n','2007-04-25 11:49:29'),(77,20,'ProjectContent',3,NULL,NULL,'update','--- \nbody_html: \n- <p><font face=\"Verdana, Arial, Helvetica, sans-serif\" size=\"2\"><strong>Peripheral                        senstization </strong></font></p>                     <ul><li><font face=\"Verdana, Arial, Helvetica, sans-serif\" size=\"2\">Bradykinin                          stimulates further synthesis/release of prostaglandins,                          and, together with the prostaglandins, sensitizes the                          primary afferent sensory fibers in response to stimulation                          by ATP, acetylcholine, serotonin and mechanical and thermal                          stimuli <font size=\"-2\">1,2,3</font></font></li><li> <font face=\"Verdana, Arial, Helvetica, sans-serif\" size=\"2\">Substance                          P and CGRP released by the primary afferent sensory fibers                          contribute to the pain response by triggering the release                          of histamine from mast cells which, in turn, excites the                          peripheral afferent sensory fibers <font size=\"-2\">1,2,3                          </font></font></li><li><font face=\"Verdana, Arial, Helvetica, sans-serif\" size=\"2\">&quot;                          Sensitization of the primary afferent sensory fibers by                          mediators of the pain response results in greater, more                          frequent transmission of action potentials to the nociceptive                          neurons than in &#39;normal&#39; pain responses <font size=\"-2\">1,2,5                          </font></font></li></ul>\n- <p><font face=\"Verdana, Arial, Helvetica, sans-serif\" size=\"2\">Bradykinin                          stimulates further synthesis/release of prostaglandins,                          and, together with the prostaglandins, sensitizes the                          primary afferent sensory fibers in response to stimulation                          by ATP, acetylcholine, serotonin and mechanical and thermal                          stimuli <font size=\"-2\">1,2,3</font></font></p><p><font face=\"Verdana, Arial, Helvetica, sans-serif\" size=\"2\">Substance                          P and CGRP released by the primary afferent sensory fibers                          contribute to the pain response by triggering the release                          of histamine from mast cells which, in turn, excites the                          peripheral afferent sensory fibers <font size=\"-2\">1,2,3</font></font></p><p><font face=\"Verdana, Arial, Helvetica, sans-serif\" size=\"2\">&quot;                          Sensitization of the primary afferent sensory fibers by                          mediators of the pain response results in greater, more                          frequent transmission of action potentials to the nociceptive                          neurons than in &#39;normal&#39; pain responses <font size=\"-2\">1,2,5                          </font></font></p>\nupdated_at: \n- 2007-04-25 11:45:45 Z\n- 2007-04-25 11:49:53.547447 Z\nlock_version: \n- 0\n- 1\n','2007-04-25 11:49:53'),(78,26,'ProjectContent',3,NULL,NULL,'create','--- \nname: \n- \n- pain-0\nbody_html: \n- \n- \"\"\nproject_id: \n- \n- 4\nupdated_at: \n- \n- &id001 2007-04-25 11:51:59.168373 Z\ntitle: \n- \n- Pain inflammatory mediators\nupdated_by_user_id: \n- 1\n- 3\nid: \n- \n- 26\ncreated_by_user_id: \n- 1\n- 3\ncreated_at: \n- \n- *id001\n','2007-04-25 11:51:59'),(79,97,'ProjectElement',3,NULL,NULL,'create','--- \nname: \n- \"\"\n- pain-0\nproject_id: \n- \n- 4\nupdated_at: \n- \n- &id001 2007-04-25 11:51:59.516691 Z\nupdated_by_user_id: \n- 1\n- 3\nid: \n- \n- 97\nreference_type: \n- \n- ProjectContent\nreference_id: \n- \n- 26\ncreated_by_user_id: \n- 1\n- 3\nposition: \n- 1\n- 10\nparent_id: \n- \n- 86\npath: \n- \"\"\n- AssayDev/Slides/pain-0\ncreated_at: \n- \n- *id001\n','2007-04-25 11:51:59'),(80,15,'ProjectAsset',3,NULL,NULL,'create','--- \ncontent_type: \n- \n- image/jpeg\nsize: \n- \n- 52802\nupdated_at: \n- \n- &id001 2007-04-25 11:52:28.521391 Z\ntitle: \n- \n- Pain inflammatory mediators_sm\nupdated_by_user_id: \n- 1\n- 3\nid: \n- \n- 15\nfilename: \n- \n- 2.Pain_inflammatory_mediators_sm.jpg\nheight: \n- \n- 150\ncreated_by_user_id: \n- 1\n- 3\nwidth: \n- \n- 200\ncreated_at: \n- \n- *id001\n','2007-04-25 11:52:28'),(81,16,'ProjectAsset',3,NULL,NULL,'create','--- \ncontent_type: \n- \n- image/jpeg\nthumbnail: \n- \n- icon\nsize: \n- \n- 53704\nupdated_at: \n- \n- &id001 2007-04-25 11:52:28.550929 Z\nupdated_by_user_id: \n- 1\n- 3\nid: \n- \n- 16\nfilename: \n- \n- 2.Pain_inflammatory_mediators_sm_icon.jpg\nheight: \n- \n- 36\ncreated_by_user_id: \n- 1\n- 3\nparent_id: \n- \n- 15\nwidth: \n- \n- 48\ncreated_at: \n- \n- *id001\n','2007-04-25 11:52:28'),(82,17,'ProjectAsset',3,NULL,NULL,'create','--- \ncontent_type: \n- \n- image/jpeg\nthumbnail: \n- \n- normal\nsize: \n- \n- 53704\nupdated_at: \n- \n- &id001 2007-04-25 11:52:28.605286 Z\nupdated_by_user_id: \n- 1\n- 3\nid: \n- \n- 17\nfilename: \n- \n- 2.Pain_inflammatory_mediators_sm_normal.jpg\nheight: \n- \n- 200\ncreated_by_user_id: \n- 1\n- 3\nparent_id: \n- \n- 15\nwidth: \n- \n- 267\ncreated_at: \n- \n- *id001\n','2007-04-25 11:52:28'),(83,98,'ProjectElement',3,NULL,NULL,'create','--- \nname: \n- \"\"\n- 2.Pain_inflammatory_mediators_sm.jpg\nproject_id: \n- \n- 4\nupdated_at: \n- \n- &id001 2007-04-25 11:52:28.932057 Z\nupdated_by_user_id: \n- 1\n- 3\nid: \n- \n- 98\nreference_type: \n- \n- ProjectAsset\nreference_id: \n- \n- 15\ncreated_by_user_id: \n- 1\n- 3\nposition: \n- 1\n- 11\nparent_id: \n- \n- 86\npath: \n- \"\"\n- AssayDev/Slides/2.Pain_inflammatory_mediators_sm.jpg\ncreated_at: \n- \n- *id001\n','2007-04-25 11:52:28'),(84,26,'ProjectContent',3,NULL,NULL,'update','--- \nbody_html: \n- \"\"\n- \"<ul><li><font face=\\\"Verdana, Arial, Helvetica, sans-serif\\\" size=\\\"2\\\">\\t                         Tissue injury causes the release of various inflammatory                          and pain mediators resulting in peripheral sensitization<font size=\\\"-2\\\">                          1,2,3</font></font></li><li><font face=\\\"Verdana, Arial, Helvetica, sans-serif\\\" size=\\\"2\\\">                          Pain response mediators: ATP, acetylcholine and serotonin                          are released from damaged endothelial cells and platelets;                          prostaglandin E2 is synthesized by Cyclooxygenase I and                          II enzymes in damaged cells; bradykinin is released from                          plasma from damaged vessels<font size=\\\"-2\\\"> 1,2</font></font></li><li><font face=\\\"Verdana, Arial, Helvetica, sans-serif\\\" size=\\\"2\\\">                          Inflammatory response mediators: Histamine is released                          from mast cells in response to Substance P and calcitonin                          gene-related peptide (CGRP) released by primary afferent                          sensory fibers; additional mediators are released from                          blood cells (cytokines, complement factors C3a and C5a,                          serotonin, platelet-activating factor, neutrophil chemotactic                          factor, fibrinopeptides, leukotrienes)<font size=\\\"-2\\\">                          1,2</font></font></li><li><font face=\\\"Verdana, Arial, Helvetica, sans-serif\\\" size=\\\"2\\\">                          Together with bradykinin and prostaglandins, these inflammatory                          mediators cause peripheral vasodilation, increased vascular                          permeability, plasma extravasation, migration of leucocytes                          to the site of injury, and clotting responses<font size=\\\"-2\\\">                          1</font> </font></li></ul>\"\nupdated_at: \n- 2007-04-25 11:51:59 Z\n- 2007-04-25 11:53:00.545411 Z\nlock_version: \n- 0\n- 1\n','2007-04-25 11:53:00'),(85,25,'ProjectContent',3,NULL,NULL,'update','--- \nbody_html: \n- \"\"\n- <font face=\"Verdana, Arial, Helvetica, sans-serif\" size=\"2\">In                          the synapse, repeated firing from peripheral afferent                          sensory fibers and consequent release of glutamate results                          in the prolonged opening of post-synaptic ion channels                          gated by N-methyl-D-aspartate (NMDA)-type glutamate receptors                          <font size=\"-2\">1,2,3</font></font>\nupdated_at: \n- 2007-04-25 11:48:55 Z\n- 2007-04-25 11:53:43.240223 Z\nlock_version: \n- 0\n- 1\n','2007-04-25 11:53:43'),(86,23,'ProjectContent',3,NULL,NULL,'update','--- \nbody_html: \n- \"\"\n- <font face=\"Verdana, Arial, Helvetica, sans-serif\" size=\"2\">Neuropathic                          pain occurs following direct injury to the nerves in the                          peripheral or central nervous systems. Neuropathic pain                          can result from complete or partial nerve transection,                          nerve compression, infiltration or infectious/inflammatory/ischemic                          etiologies <font size=\"-2\">1,2,4</font></font>                          <font face=\"Verdana, Arial, Helvetica, sans-serif\" size=\"2\">                              Partial severance of peripheral afferent sensory fibers                              results in neuropathic pain in the form of ectopic                              activity</font>\nupdated_at: \n- 2007-04-25 11:47:39 Z\n- 2007-04-25 11:54:23.066914 Z\nlock_version: \n- 0\n- 1\n','2007-04-25 11:54:23'),(87,21,'ProjectContent',3,NULL,NULL,'update','--- \nbody_html: \n- \"\"\n- \"<font face=\\\"Verdana, Arial, Helvetica, sans-serif\\\" size=\\\"2\\\">                          Hyperalgesia: Certain noxious stimuli (e.g. severe bruising)                          can result in the individual perceiving abnormally high                          levels of pain in response to normal noxious stimuli such                          as a small scratch; in such cases, patients often perceive                          spontaneous pain <font size=\\\"-2\\\">1,2,4</font></font>\"\nupdated_at: \n- 2007-04-25 11:46:15 Z\n- 2007-04-25 11:54:50.149991 Z\nlock_version: \n- 0\n- 1\n','2007-04-25 11:54:50'),(88,27,'ProjectContent',3,NULL,NULL,'create','--- \nname: \n- \n- ProjectContent-16\nbody_html: \n- \n- tests\nproject_id: \n- \n- 4\nupdated_at: \n- \n- &id001 2007-04-25 13:39:46.205355 Z\ntitle: \n- \n- test tags\nupdated_by_user_id: \n- 1\n- 3\nid: \n- \n- 27\ncreated_by_user_id: \n- 1\n- 3\ncreated_at: \n- \n- *id001\n','2007-04-25 13:39:46'),(89,99,'ProjectElement',3,NULL,NULL,'create','--- \nname: \n- \"\"\n- ProjectContent-16\nproject_id: \n- \n- 4\nupdated_at: \n- \n- &id001 2007-04