,NULL,'update','--- \nname: \n- h1\n- Hyper.1\nupdated_at: \n- 2007-04-25 11:46:15 Z\n- 2007-04-25 20:43:49.852732 Z\nlock_version: \n- 0\n- 1\n','2007-04-25 20:43:49'),(119,21,'ProjectContent',3,NULL,NULL,'update','--- \nbody_html: \n- \"<p><font face=\\\"Verdana, Arial, Helvetica, sans-serif\\\" size=\\\"2\\\">                          Hyperalgesia: Certain noxious stimuli (e.g. severe bruising)                          can result in the individual perceiving abnormally high                          levels of pain in response to normal noxious stimuli such                          as a small scratch; in such cases, patients often perceive                          spontaneous pain <font size=\\\"-2\\\">1,2,4</font></font></p><p>&nbsp;</p><p>&nbsp;</p>\"\n- \"<p><font face=\\\"Verdana, Arial, Helvetica, sans-serif\\\" size=\\\"2\\\">                          Hyperalgesia: Certain noxious stimuli (e.g. severe bruising)                          can result in the individual perceiving abnormally high                          levels of pain in response to normal noxious stimuli such                          as a small scratch; in such cases, patients often perceive                          spontaneous pain <font size=\\\"-2\\\">1,2,4</font></font></p><p>&nbsp;<font face=\\\"Verdana, Arial, Helvetica, sans-serif\\\" size=\\\"2\\\"><strong>References:</strong></font></p>               <p><font face=\\\"Verdana, Arial, Helvetica, sans-serif\\\" size=\\\"2\\\">1.                  Kandel ER, Schwartz JH, Jessell TM, editors. Principles of Neural                  Science (Fourth Edition). New York: McGraw Hill (Health Professions                  Division). 2000;472-491. </font></p>               <p><font face=\\\"Verdana, Arial, Helvetica, sans-serif\\\" size=\\\"2\\\">2.                  Millan MJ. Progress in Neurobiology 1999;57:1-164. </font></p>               <p><font face=\\\"Verdana, Arial, Helvetica, sans-serif\\\" size=\\\"2\\\">3.                  Dickenson AH. Brit J Anaesthesia 1995;75:193-200. </font></p>               <p><font face=\\\"Verdana, Arial, Helvetica, sans-serif\\\" size=\\\"2\\\">4.                  Suzuki R and Dickenson AH. Neuroreport 2000;11:R17-21. </font></p>               <p><font face=\\\"Verdana, Arial, Helvetica, sans-serif\\\" size=\\\"2\\\">5.                  Waxman S. Pain 1999;6:S133-140. </font></p><p>&nbsp;</p>\"\nupdated_at: \n- 2007-04-25 20:43:49 Z\n- 2007-04-25 20:45:21.073158 Z\nlock_version: \n- 4\n- 5\n','2007-04-25 20:45:21'),(120,92,'ProjectElement',3,NULL,NULL,'update','--- \nupdated_at: \n- 2007-04-25 20:43:49 Z\n- 2007-04-25 20:45:21.112485 Z\nlock_version: \n- 1\n- 2\n','2007-04-25 20:45:21'),(121,37,'ProjectContent',3,NULL,NULL,'create','--- \nname: \n- \n- ProjectContent-43\nproject_id: \n- \n- 4\nbody_html: \n- \n- \"<?xml version=\\\"1.0\\\" encoding=\\\"utf-8\\\"?> <!DOCTYPE html PUBLIC \\\"-//W3C//DTD XHTML 1.0 Transitional//EN\\\" \\\"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\\\"> <html xmlns=\\\"http://www.w3.org/1999/xhtml\\\" lang=\\\"en\\\" xml:lang=\\\"en\\\"> <head> \\t<title>Untitled document</title> \\t<meta http-equiv=\\\"Content-Type\\\" content=\\\"text/html; charset=utf-8\\\" /> </head> <body> <ul class=\\\"clearfix\\\"><li>K. Fecho<a href=\\\"javascript:popRef(&#39;a1%20a2&#39;)\\\" class=\\\"nameLink\\\">*<sup>,</sup>&dagger;<span class=\\\"tooltip\\\"><span class=\\\"item first odd\\\">*Department of Anesthesiology, Division of Pain Medicine</span><span class=\\\"item last even\\\">&dagger;Curriculum in Neurobiology</span></span></a> and </li><li>J. G. Valtschanoff<a href=\\\"javascript:popRef(&#39;a2%20a3&#39;)\\\" class=\\\"nameLink\\\">&dagger;<sup>,</sup>&Dagger;<span class=\\\"tooltip\\\"><span class=\\\"item first odd\\\">&dagger;Curriculum in Neurobiology</span><span class=\\\"item last even\\\">&Dagger;Department of Cell and Developmental Biology, School of Medicine, The University of North Carolina at Chapel Hill, Chapel Hill, NC, USA.</span></span></a></li></ul><ul class=\\\"author_affiliations\\\"><li><address><span class=\\\"first\\\">*Department of Anesthesiology, Division of Pain Medicine</span>, <span>&dagger;Curriculum in Neurobiology</span> and <span class=\\\"last\\\">&Dagger;Department of Cell and Developmental Biology, School of Medicine, The University of North Carolina at Chapel Hill, Chapel Hill, NC, USA.</span></address></li></ul><address class=\\\"author_address\\\">Dr Karamarie Fecho, Department of Anesthesiology, The University of North Carolina at Chapel Hill, CB #7010, 335 MacNider Hall, Chapel Hill, North Carolina 27599-7010, USA (e-mail: <a href=\\\"mailto:kfecho@aims.unc.edu\\\" class=\\\"externallink\\\">kfecho@aims.unc.edu</a>).</address><p>&nbsp;</p><p>Inbred, histocompatible Lewis and Fischer 344 rats (LEW and FIS) have been used to identify an inverse relationship between hypothalamic-pituitary-adrenal (HPA) axis activity and susceptibility to autoimmune and chronic inflammatory disorders, with LEW showing blunted HPA axis activity and increased susceptibility toward the development of autoimmunity and chronic inflammation, and FIS showing the opposite relationship. In the present study, LEW and FIS were used to determine the relationship between HPA axis function and acute inflammatory pain (carrageenan-induced hindpaw inflammation) and neuropathic pain (partial sciatic nerve ligation; PSNL). The results showed that carrageenan-induced thermal and mechanical allodynia and hyperalgesia were greater in FIS than in LEW. Similarly, FIS showed more carrageenan-induced hindpaw swelling and higher levels of myeloperoxidase (a measure of neutrophils) in the carrageenan-inflamed hindpaw. After PSNL, LEW showed a profound mechanical allodynia and hyperalgesia, whereas mechanical sensitivity in FIS was unaltered. However, FIS, but not LEW, developed thermal allodynia and hyperalgesia after PSNL. These results provide strong evidence for a positive relationship between HPA axis activity and acute inflammatory pain. The results also support a relationship between HPA axis activity and neuropathic pain, but the relationship is complex and may depend on the pain assay.</p> </body> </html>\"\nupdated_at: \n- \n- &id001 2007-04-25 21:01:15.720435 Z\ntitle: \n- \n- Acute Inflammatory and Neuropathic Pain in Lewis and Fischer Rats\nupdated_by_user_id: \n- 1\n- 3\nid: \n- \n- 37\ncreated_by_user_id: \n- 1\n- 3\ncreated_at: \n- \n- *id001\n','2007-04-25 21:01:15'),(122,112,'ProjectElement',3,NULL,NULL,'create','--- \nname: \n- \"\"\n- ProjectContent-43\nproject_id: \n- \n- 4\ncontent_id: \n- \n- 37\nupdated_at: \n- \n- &id001 2007-04-25 21:01:16.080672 Z\nupdated_by_user_id: \n- 1\n- 3\nid: \n- \n- 112\ncreated_by_user_id: \n- 1\n- 3\nposition: \n- 1\n- 0\nparent_id: \n- \n- 105\npath: \n- \"\"\n- AssayDev/Solubility/ProjectContent-43\ncreated_at: \n- \n- *id001\n','2007-04-25 21:01:16'),(123,112,'ProjectElement',3,NULL,NULL,'update','--- \nupdated_at: \n- 2007-04-25 21:01:16.080672 Z\n- 2007-04-25 21:01:16.130759 Z\nlock_version: \n- 0\n- 1\n','2007-04-25 21:01:16'),(124,37,'ProjectContent',3,NULL,NULL,'update','--- \nbody_html: \n- \"<?xml version=\\\"1.0\\\" encoding=\\\"utf-8\\\"?> <!DOCTYPE html PUBLIC \\\"-//W3C//DTD XHTML 1.0 Transitional//EN\\\" \\\"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\\\"> <html xmlns=\\\"http://www.w3.org/1999/xhtml\\\" lang=\\\"en\\\" xml:lang=\\\"en\\\"> <head> \\t<title>Untitled document</title> \\t<meta http-equiv=\\\"Content-Type\\\" content=\\\"text/html; charset=utf-8\\\" /> </head> <body> <ul class=\\\"clearfix\\\"><li>K. Fecho<a href=\\\"javascript:popRef(&#39;a1%20a2&#39;)\\\" class=\\\"nameLink\\\">*<sup>,</sup>&dagger;<span class=\\\"tooltip\\\"><span class=\\\"item first odd\\\">*Department of Anesthesiology, Division of Pain Medicine</span><span class=\\\"item last even\\\">&dagger;Curriculum in Neurobiology</span></span></a> and </li><li>J. G. Valtschanoff<a href=\\\"javascript:popRef(&#39;a2%20a3&#39;)\\\" class=\\\"nameLink\\\">&dagger;<sup>,</sup>&Dagger;<span class=\\\"tooltip\\\"><span class=\\\"item first odd\\\">&dagger;Curriculum in Neurobiology</span><span class=\\\"item last even\\\">&Dagger;Department of Cell and Developmental Biology, School of Medicine, The University of North Carolina at Chapel Hill, Chapel Hill, NC, USA.</span></span></a></li></ul><ul class=\\\"author_affiliations\\\"><li><address><span class=\\\"first\\\">*Department of Anesthesiology, Division of Pain Medicine</span>, <span>&dagger;Curriculum in Neurobiology</span> and <span class=\\\"last\\\">&Dagger;Department of Cell and Developmental Biology, School of Medicine, The University of North Carolina at Chapel Hill, Chapel Hill, NC, USA.</span></address></li></ul><address class=\\\"author_address\\\">Dr Karamarie Fecho, Department of Anesthesiology, The University of North Carolina at Chapel Hill, CB #7010, 335 MacNider Hall, Chapel Hill, North Carolina 27599-7010, USA (e-mail: <a href=\\\"mailto:kfecho@aims.unc.edu\\\" class=\\\"externallink\\\">kfecho@aims.unc.edu</a>).</address><p>&nbsp;</p><p>Inbred, histocompatible Lewis and Fischer 344 rats (LEW and FIS) have been used to identify an inverse relationship between hypothalamic-pituitary-adrenal (HPA) axis activity and susceptibility to autoimmune and chronic inflammatory disorders, with LEW showing blunted HPA axis activity and increased susceptibility toward the development of autoimmunity and chronic inflammation, and FIS showing the opposite relationship. In the present study, LEW and FIS were used to determine the relationship between HPA axis function and acute inflammatory pain (carrageenan-induced hindpaw inflammation) and neuropathic pain (partial sciatic nerve ligation; PSNL). The results showed that carrageenan-induced thermal and mechanical allodynia and hyperalgesia were greater in FIS than in LEW. Similarly, FIS showed more carrageenan-induced hindpaw swelling and higher levels of myeloperoxidase (a measure of neutrophils) in the carrageenan-inflamed hindpaw. After PSNL, LEW showed a profound mechanical allodynia and hyperalgesia, whereas mechanical sensitivity in FIS was unaltered. However, FIS, but not LEW, developed thermal allodynia and hyperalgesia after PSNL. These results provide strong evidence for a positive relationship between HPA axis activity and acute inflammatory pain. The results also support a relationship between HPA axis activity and neuropathic pain, but the relationship is complex and may depend on the pain assay.</p> </body> </html>\"\n- \"<?xml version=\\\"1.0\\\" encoding=\\\"utf-8\\\"?> <!DOCTYPE html PUBLIC \\\"-//W3C//DTD XHTML 1.0 Transitional//EN\\\" \\\"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\\\"> <html xmlns=\\\"http://www.w3.org/1999/xhtml\\\" lang=\\\"en\\\" xml:lang=\\\"en\\\"> <head> \\t<title>Untitled document</title> \\t<meta http-equiv=\\\"Content-Type\\\" content=\\\"text/html; charset=utf-8\\\" /> </head> <body> <ul class=\\\"clearfix\\\"><li>K. Fecho<a href=\\\"javascript:popRef(&#39;a1%20a2&#39;)\\\" class=\\\"nameLink\\\">*<sup>,</sup>&dagger;<span class=\\\"tooltip\\\"><span class=\\\"item first odd\\\">*Department of Anesthesiology, Division of Pain Medicine</span><span class=\\\"item last even\\\">&dagger;Curriculum in Neurobiology</span></span></a> and </li><li>J. G. Valtschanoff<a href=\\\"javascript:popRef(&#39;a2%20a3&#39;)\\\" class=\\\"nameLink\\\">&dagger;<sup>,</sup>&Dagger;<span class=\\\"tooltip\\\"><span class=\\\"item first odd\\\">&dagger;Curriculum in Neurobiology</span><span class=\\\"item last even\\\">&Dagger;Department of Cell and Developmental Biology, School of Medicine, The University of North Carolina at Chapel Hill, Chapel Hill, NC, USA.</span></span></a></li></ul><ul class=\\\"author_affiliations\\\"><li><address><span class=\\\"first\\\">*Department of Anesthesiology, Division of Pain Medicine</span>, <span>&dagger;Curriculum in Neurobiology</span> and <span class=\\\"last\\\">&Dagger;Department of Cell and Developmental Biology, School of Medicine, The University of North Carolina at Chapel Hill, Chapel Hill, NC, USA.</span></address></li></ul><address class=\\\"author_address\\\">Dr Karamarie Fecho, Department of Anesthesiology, The University of North Carolina at Chapel Hill, CB #7010, 335 MacNider Hall, Chapel Hill, North Carolina 27599-7010, USA (e-mail: <a href=\\\"mailto:kfecho@aims.unc.edu\\\" class=\\\"externallink\\\">kfecho@aims.unc.edu</a>).</address><p>&nbsp;</p><p>Inbred, histocompatible Lewis and Fischer 344 rats (LEW and FIS) have been used to identify an inverse relationship between hypothalamic-pituitary-adrenal (HPA) axis activity and susceptibility to autoimmune and chronic inflammatory disorders, with LEW showing blunted HPA axis activity and increased susceptibility toward the development of autoimmunity and chronic inflammation, and FIS showing the opposite relationship. In the present study, LEW and FIS were used to determine the relationship between HPA axis function and acute inflammatory pain (carrageenan-induced hindpaw inflammation) and neuropathic pain (partial sciatic nerve ligation; PSNL). The results showed that carrageenan-induced thermal and mechanical allodynia and hyperalgesia were greater in FIS than in LEW. Similarly, FIS showed more carrageenan-induced hindpaw swelling and higher levels of myeloperoxidase (a measure of neutrophils) in the carrageenan-inflamed hindpaw. After PSNL, LEW showed a profound mechanical allodynia and hyperalgesia, whereas mechanical sensitivity in FIS was unaltered. However, FIS, but not LEW, developed thermal allodynia and hyperalgesia after PSNL. These results provide strong evidence for a positive relationship between HPA axis activity and acute inflammatory pain. The results also support a relationship between HPA axis activity and neuropathic pain, but the relationship is complex and may depend on the pain assay.</p>  </body> </html>\"\nupdated_at: \n- 2007-04-25 21:01:15 Z\n- 2007-04-25 21:03:08.763211 Z\nlock_version: \n- 0\n- 1\n','2007-04-25 21:03:08'),(125,112,'ProjectElement',3,NULL,NULL,'update','--- \nupdated_at: \n- 2007-04-25 21:01:16 Z\n- 2007-04-25 21:03:08.786578 Z\nlock_version: \n- 1\n- 2\n','2007-04-25 21:03:08'),(126,22,'ProjectContent',3,NULL,NULL,'update','--- \nbody_html: \n- \"<font face=\\\"Verdana, Arial, Helvetica, sans-serif\\\"><strong><font size=\\\"2\\\">Allodynia</font></strong></font>                     <ul><li><font face=\\\"Verdana, Arial, Helvetica, sans-serif\\\" size=\\\"2\\\">                          Tissue injury often results in nociceptive pain, in which                          persistent pain is felt in response to direct activation                          of peripheral nerve terminals in the skin by pain response                          mediators from the damaged tissue<font size=\\\"-2\\\"> 1,2                          </font></font></li><li><font face=\\\"Verdana, Arial, Helvetica, sans-serif\\\" size=\\\"2\\\">                          Nociceptive pain: Following tissue injury, Substance P,                          CGRP and glutamate are released by peripheral afferent                          sensory fibers and act on peptide and glutamate receptors                          on the post-synaptic membrane to cause greater excitability                          of nociceptive neurons. Nociceptive neurons become hyperexcitable,                          resulting in central sensitization and thus greater perception                          of pain in the higher centers <font size=\\\"-2\\\">1,2,3</font></font></li><li><font face=\\\"Verdana, Arial, Helvetica, sans-serif\\\" size=\\\"2\\\">                          Nociceptive pain may involve the abnormal pain states                          of allodynia or hyperalgesia which result from both peripheral                          and central hypersensitivity <font size=\\\"-2\\\">1,2,3</font></font></li><li><font face=\\\"Verdana, Arial, Helvetica, sans-serif\\\" size=\\\"2\\\">                          Allodynia: Certain types of noxious stimulus (e.g. sunburn,                          injury, post-surgical wounds) may result in the individual                          perceiving pain in response to stimuli that are not normally                          painful, such as a light stroking of the skin<font size=\\\"-3\\\">                          1,2,4 </font></font></li></ul>\"\n- \"<?xml version=\\\"1.0\\\" encoding=\\\"utf-8\\\"?> <!DOCTYPE html PUBLIC \\\"-//W3C//DTD XHTML 1.0 Transitional//EN\\\" \\\"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\\\"> <html xmlns=\\\"http://www.w3.org/1999/xhtml\\\" lang=\\\"en\\\" xml:lang=\\\"en\\\"> <head> \\t<title>Untitled document</title> \\t<meta http-equiv=\\\"Content-Type\\\" content=\\\"text/html; charset=utf-8\\\" /> </head> <body> <font face=\\\"Verdana, Arial, Helvetica, sans-serif\\\"><strong><font size=\\\"2\\\">Allodynia</font></strong></font>                     <ul><li><font face=\\\"Verdana, Arial, Helvetica, sans-serif\\\" size=\\\"2\\\">                          Tissue injury often results in nociceptive pain, in which                          persistent pain is felt in response to direct activation                          of peripheral nerve terminals in the skin by pain response                          mediators from the damaged tissue<font size=\\\"-2\\\"> 1,2                          </font></font></li><li><font face=\\\"Verdana, Arial, Helvetica, sans-serif\\\" size=\\\"2\\\">                          Nociceptive pain: Following tissue injury, Substance P,                          CGRP and glutamate are released by peripheral afferent                          sensory fibers and act on peptide and glutamate receptors                          on the post-synaptic membrane to cause greater excitability                          of nociceptive neurons. Nociceptive neurons become hyperexcitable,                          resulting in central sensitization and thus greater perception                          of pain in the higher centers <font size=\\\"-2\\\">1,2,3</font></font></li><li><font face=\\\"Verdana, Arial, Helvetica, sans-serif\\\" size=\\\"2\\\">                          Nociceptive pain may involve the abnormal pain states                          of allodynia or hyperalgesia which result from both peripheral                          and central hypersensitivity <font size=\\\"-2\\\">1,2,3</font></font></li><li><font face=\\\"Verdana, Arial, Helvetica, sans-serif\\\" size=\\\"2\\\">                          Allodynia: Certain types of noxious stimulus (e.g. sunburn,                          injury, post-surgical wounds) may result in the individual                          perceiving pain in response to stimuli that are not normally                          painful, such as a light stroking of the skin<font size=\\\"-3\\\">                          1,2,4 </font></font></li></ul> </body> </html>\"\nupdated_at: \n- 2007-04-25 11:49:29 Z\n- 2007-04-25 21:16:34.196636 Z\nlock_version: \n- 1\n- 2\n','2007-04-25 21:16:34'),(127,93,'ProjectElement',3,NULL,NULL,'update','--- \nupdated_at: \n- 2007-04-25 11:47:04 Z\n- 2007-04-25 21:16:34.235018 Z\nlock_version: \n- 0\n- 1\n','2007-04-25 21:16:34'),(128,35,'ProjectContent',3,NULL,NULL,'update','--- \nbody_html: \n- testgs\n- \"<?xml version=\\\"1.0\\\" encoding=\\\"utf-8\\\"?> <!DOCTYPE html PUBLIC \\\"-//W3C//DTD XHTML 1.0 Transitional//EN\\\" \\\"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\\\"> <html xmlns=\\\"http://www.w3.org/1999/xhtml\\\" lang=\\\"en\\\" xml:lang=\\\"en\\\"> <head> \\t<title>Untitled document</title> \\t<meta http-equiv=\\\"Content-Type\\\" content=\\\"text/html; charset=utf-8\\\" /> </head> <body>   <p align=\\\"center\\\"><strong>MAQC Study - Data Generation Plan </strong>(<em>DRAFT) </em></p>  <p align=\\\"center\\\"><strong><em>Genospectra Quanti</em></strong><strong><em>G</em></strong><strong><em>ene Platform </em></strong></p>    <p><strong>Test Site </strong></p>  <p>&nbsp;Genospectra, Inc.</p>  <p>Contact person: Yuling Luo </p>  <p>Address: 6519 Dumbarton Circle,  Fremont, CA 94555 </p>  <p>Phone: 510.818.2623</p>  <p>Email: yluo@genospectra.com</p>    <p>&nbsp;<strong>Materials Required </strong></p>    <p>&nbsp;<strong><em>Genospectra Products </em></strong></p>  <ul><li> QuantiGene kits</li><li> Gene-specific probe sets for over 200 genes</li></ul>    <p>&nbsp;</p>  <p><strong><em>Non-Genospectra Products </em></strong></p>  <ul><li> Total RNA, Brain (Ambion)(AB) </li><li> Total RNA, Universal Human Reference RNA (Stratagene) (UHRR)</li><li> Total RNA, Mixture of 75% AB + 25% UHRR</li><li> Total RNA, Mixture of 25% AB + 75% UHRR</li></ul>        <p>&nbsp;</p>  <p><strong><em>Equipment and consumables </em></strong></p>  <ul><li> General laboratory equipment include a 96-well plate-based luminometer (Lmax, Molecular Device) and a hybridization incubator (Hybaid) capable of maintaining temperature between 46&ordm;C and 53&ordm;C.</li><li> General consumables are listed in the QuantiGene assay SOP manual</li></ul>    <p>&nbsp;</p>  <p><strong><em>User Manuals </em></strong></p>  <ul><li> Genospectra QuantiGene Assay SOP Manual</li></ul>  <p>&nbsp;</p>  <p><strong>Experimental Design</strong></p>  <p>&nbsp;</p>  <p>Minimal of 200 genes will be selected for the QuantiGene assay and agreed to by MAQC. The 200 gene will be matched within the ABI&#39;s 1,000 gene list, which will be matched within the list of 5,000 RefSeq genes shared by all microarray platforms. The 200 genes will be selected to cover different expression level, fold changes, and some genes showing cross-platform discrepancy in the pilot study.</p>  <p><strong>&nbsp;</strong></p>  <p><strong>Agreement need to be reached among Genospectra, ABI, and Stratagene for the platform validation assays</strong>. Three, four or five replicate measurements for each gene can be processed for each of the following mRNA samples, depending on the agreement among Genospectra, ABI, and Stratagene: </p>  <p>1. UHRR (100%)</p>  <p>2. AB (25%) vs. UHRR (75%) </p>  <p>3. AB (75%) vs. UHRR (25%) </p>  <p>4. AB (100%)</p>  <p>&nbsp;</p>  <p><strong>Total RNA Preparation and Analysis </strong></p>  <p>&nbsp;</p>  <p>It is assumed that all four total RNA samples will be provided in aqueous solution ready for use.<strong> </strong>The total RNA samples will be stored at -80 <sup>o</sup>C and will be used directly in the QuantiGene assay, unless there is a need to dilute the sample further. No additional manipulation is required for the QuantiGene assay. As a result, we rely on the quality assessment of the original total RNA samples by Ambion and Stratagene.</p>  <p>&nbsp;</p>  <p><strong><em>QuantiGene&reg; assay conditions:</em></strong></p>  <p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 1.&nbsp; Stock total RNA samples will be diluted to [40ng/ul] in RNase Free water. </p>  <p>2.&nbsp; 100 to 800ng of total RNA will be added to each well of QuantiGene assay, depending on the gene expression level.</p>  <p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 3. Hybridization assay will be carried out per QuantiGene&reg; manual.</p>  <p>4. Background signal for each gene will be assessed in a QuantiGene assay with no sample RNA added, just the probe set.</p>  <p>&nbsp;</p>  <p><strong>Data Acquisition and Analysis </strong></p>  <p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; QuantiGene assay signal is measured by a luminometer, and the Relative Luminescent Unit (RLU) data will be directly read from the luminometer machine. The data will be exported into an Excel file and reported directly to MAQC. </p>  <p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; For those genes (e.g. selected genes from MAQC pilot II study) whose expression in AB and UHRR is substantially different (e.g. over 100: 1 ratio), we expect an assay signal ratio of 100: 75:25:0 ratio for the four total RNA samples. The closeness to the expected 100:75:25:0 ratio will be a measurement of the assay platform accuracy. &nbsp;</p>  <p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Once the assay platform accuracy is established, the relative ratio of the 200 genes among different samples will be assessed, and their correlation with the data from other platforms will be compared.</p>  <p>&nbsp;</p>    <p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <strong>Overview of the QuantiGene Workflow</strong></p>  <p><strong>&nbsp;</strong></p>  <p><strong>&nbsp;</strong></p>  <p><strong>Day One:</strong></p>  <p><!--[if gte vml 1]><![endif]--><img alt=\\\"\\\" width=\\\"566\\\" height=\\\"2\\\" /><strong>&nbsp;</strong></p>  <h2>&nbsp;</h2>  <br />  <h2>A.&nbsp;&nbsp;&nbsp;&nbsp; Prepare the QuantiGene<sup>&reg;</sup> Reagents and gene-specific Probe Set</h2>  <p>&nbsp;</p>  <h2>B.&nbsp;&nbsp;&nbsp;&nbsp; Prepare RNA samples for the selected genes.</h2>  <p>&nbsp;</p>  <ol><li>Follow Experimental Layout on      Plate Map.</li></ol>  <p>&nbsp;</p>  <p>&nbsp;</p>  <p>&nbsp;</p>  <p><strong>Day Two:</strong></p>  <p><!--[if gte vml 1]><![endif]--><img alt=\\\"\\\" width=\\\"566\\\" height=\\\"2\\\" /><strong>&nbsp;</strong></p>  <p><strong>&nbsp;</strong></p>  <ol><br /><li>Prepare      the QuantiGene Reagents used for the target mRNA.</li></ol>  <p>&nbsp;</p>  <h2>E.&nbsp;&nbsp;&nbsp;&nbsp; Amplify the Signal and Detect target mRNA.</h2>  <p>&nbsp;</p>  <ol><li>Analyze the Data.</li></ol>  <h1>&nbsp;</h1>  <p>&nbsp;</p>  <strong><u> </u></strong>  <p>&nbsp;</p>  <p align=\\\"center\\\"><strong><ins datetime=\\\"2004-12-13T15:12\\\" cite=\\\"mailto:Kate%20Stankis\\\">QuantiGene </ins>Assay</strong><strong> SOP</strong></p>  <p>PURPOSE:</p>  <p>This protocol describes the procedure for performing, single-plex QuantiGene assays with purified RNA using the LMAX luminometer.</p>  <p>SCOPE:</p>  <p>This procedure applies to all R&amp;D personnel performing a QuantiGene single-plex assay using purified RNA or IVTs as the sample source.</p>  <p>KEY SPONSOR and responsibility: </p>  <p>The R&amp;D Manager is responsible for the content, updating and implementation of this document.</p>  <p>eQUIPMENT:</p>  <p>1.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Pipettes, single and multichannel</p>  <p>2.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Vortex mixer</p>  <p>3.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; LMAX luminometer</p>  <p>4.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Incubators:&nbsp; 46&deg; +/-1.0&deg;C and 53&deg; C +/- 1.0&deg; C</p>  <p>5.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Quick spin bench top micro-centrifuge</p>  <p>mATERIALS</p>  <p>1.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; QuantiGene Assay Kit (at 4&deg;C - capture plates, amplifier, label probe, substrate; at 15-30&deg;C -&nbsp; amplifier/label probe diluent, lysis mixture)</p>  <p>2.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Plastic pipette tips, aerosol resistant</p>  <p>3.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Disposable reagent reservoirs, 25 and 100 mL capacity</p>  <p>4.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Plate Sealers (Bioexpress, Cat. No. T-3025-8B)</p>  <p>5.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 10X or 1X Wash Buffer</p>  <p>6.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 10% Lithium Lauryl Sulfate solution</p>  <p>7.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Capture Buffer</p>  <p>8.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 1 mg/mL tRNA (Blocking Agent)</p>  <p>9.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Purified total RNA, mRNA, or IVT RNA</p>  <p>10. Appropriate Probe Set(s) with pooled Label Extenders, pooled Capture Extenders and pooled Blocking Probes</p>  <p>11. Nuclease Free water </p>    testgs </body> </html>\"\nupdated_at: \n- 2007-04-25 20:17:28 Z\n- 2007-04-25 21:20:30.532370 Z\ntitle: \n- tet\n- \"MAQC Study - Data Generation Plan \"\nlock_version: \n- 0\n- 1\n','2007-04-25 21:20:30'),(129,110,'ProjectElement',3,NULL,NULL,'update','--- \nupdated_at: \n- 2007-04-25 20:17:28 Z\n- 2007-04-25 21:20:30.570091 Z\nlock_version: \n- 1\n- 2\n','2007-04-25 21:20:30'),(130,30,'ProjectContent',3,NULL,NULL,'update','--- \nbody_html: \n- \"\"\n- <?xml version=\"1.0\" encoding=\"utf-8\"?> <!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\" \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\"> <html xmlns=\"http://www.w3.org/1999/xhtml\" lang=\"en\" xml:lang=\"en\"> <head> 	<title>Untitled document</title> 	<meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\" /> </head> <body> <font face=\"Verdana, Arial, Helvetica\" size=\"2\"><font face=\"Verdana,Arial,Helvetica\" size=\"2\">he HRP2 drug sensitivity assay is based on the measurement of the increase in HRP2 concentrations in <em>P. falciparum</em> culture samples. HRP2 is being produced in the course of parasite growth and propagation and may easily be measured in a simple ELISA. If parasite growth is inhibited by antmalarial drugs, the inhibition is reflected in HRP2 levels and may therefore easily be quantified.<br /><br /> The culture procedures are similar to other drug sensitivity assays (e.g. isotopic assay), except that the HRP2 assay is very sensitive and therefore requires only low parasite densities. The HRP2 concentrations are determined with a commercial ELISA test kit (Malaria Ag CELISA, Cellabs Pty. Ltd., Brookvale, NSW, Australia; http://www.cellabs.com.au) which takes only about 2.5 hours to perform.<br /><br /> In a first evaluation with culture adapted parasite strains, the assay proved to be sensitive, simple to establish and highly reproducible. It may be carried out with commercial test kits and requires relatively little technical equipment. In correlation analysis (and to a lower extent in Bland-Altman plots) the results closely paralleled those obtained from the isotopic assay (R = 0.892; P &lt; 0.0001) and from a modified WHO schizont maturation test (R = 0.959; P &lt; 0.0001). It may therefore be used for a wide range of applications from epidemiological studies to the screening of new drugs, and may have the potential to replace traditional <em>in vitro</em> techniques, such as the isotopic assay.</font></font> </body> </html>\nupdated_at: \n- 2007-04-25 20:04:02 Z\n- 2007-04-25 21:23:28.810270 Z\ntitle: \n- \"\"\n- T H E   H R P 2   A S S A Y   -   G E N E R A L   I N F O R M A T I O N\nlock_version: \n- 0\n- 1\n','2007-04-25 21:23:28'),(131,106,'ProjectElement',3,NULL,NULL,'update','--- \nupdated_at: \n- 2007-04-25 20:04:02 Z\n- 2007-04-25 21:23:28.834217 Z\nlock_version: \n- 0\n- 1\n','2007-04-25 21:23:28'),(132,91,'ProjectElement',3,NULL,NULL,'update','--- \nupdated_at: \n- 2007-04-25 11:45:45 Z\n- 2007-04-25 21:42:24.704594 Z\nlock_version: \n- 0\n- 1\nposition: \n- 4\n- 0\n','2007-04-25 21:42:24'),(133,94,'ProjectElement',3,NULL,NULL,'update','--- \nupdated_at: \n- 2007-04-25 11:47:39 Z\n- 2007-04-25 21:42:42.181655 Z\nlock_version: \n- 0\n- 1\nposition: \n- 7\n- 2\n','2007-04-25 21:42:42'),(134,93,'ProjectElement',3,NULL,NULL,'update','--- \nupdated_at: \n- 2007-04-25 21:16:34 Z\n- 2007-04-25 21:42:49.582534 Z\nlock_version: \n- 1\n- 2\nposition: \n- 7\n- 4\n','2007-04-25 21:42:49'),(135,95,'ProjectElement',3,NULL,NULL,'update','--- \nupdated_at: \n- 2007-04-25 11:48:24 Z\n- 2007-04-25 21:42:56.210174 Z\nlock_version: \n- 0\n- 1\nposition: \n- 8\n- 6\n','2007-04-25 21:42:56'),(136,92,'ProjectElement',3,NULL,NULL,'update','--- \nupdated_at: \n- 2007-04-25 20:45:21 Z\n- 2007-04-25 21:43:03.431163 Z\nlock_version: \n- 2\n- 3\nposition: \n- 8\n- 7\n','2007-04-25 21:43:03'),(137,100,'ProjectElement',3,NULL,NULL,'update','--- \nupdated_at: \n- 2007-04-25 15:08:30 Z\n- 2007-04-25 21:43:17.774777 Z\nlock_version: \n- 0\n- 1\nposition: \n- 13\n- 10\n','2007-04-25 21:43:18'),(138,91,'ProjectElement',3,NULL,NULL,'update','--- \nupdated_at: \n- 2007-04-25 21:42:24 Z\n- 2007-04-25 21:45:15.679647 Z\nlock_version: \n- 1\n- 2\nposition: \n- 4\n- 1\n','2007-04-25 21:45:15'),(139,88,'ProjectElement',3,NULL,NULL,'update','--- \nupdated_at: \n- 2007-04-25 11:35:18 Z\n- 2007-04-25 21:45:39.874385 Z\nlock_version: \n- 0\n- 1\n