INSERT INTO `data_concepts` VALUES (1,NULL,'BioRails',1,'This is the main <strong>context </strong>or<strong> conceptual name space </strong>for all key <strong>concepts </strong>in the core BioRails application. The context is divided into a logical tree of concepts.&nbsp; These concepts can be extended with child concepts providing&nbsp; the possibility of <strong>value lookup lists</strong> defined against each concept. In-use concepts<strong> </strong>are linked to <strong>parameter types </strong>at the global catalogue level. Parameter types are then implemented as <strong>study parameters</strong> and a linked lookup <strong>element </strong>may be used.<br />\r\n<br />\r\nThis structure provides a solid division of control between global warehousing need and local terminology, put more simply, the scientists can maintain their own (often unique) terminologies which can be mapped into the corporate dictionaries.',NULL,3,'2007-01-22 15:23:29','2007-01-23 20:54:17','DataContext',1,1),(2,1,'Subject',1,'Subject',NULL,1,'2006-09-06 19:33:33','2006-09-06 19:33:33','DataConcept',1,1),(3,1,'Study',1,'Study',NULL,1,'2006-09-06 19:35:22','2006-09-06 19:35:22','DataConcept',1,1),(4,2,'Compound',1,'Compound Inventory',NULL,5,'2006-09-06 19:35:33','2006-10-09 16:01:50','DataConcept',1,1),(5,2,'Batch',1,'Batch',NULL,1,'2006-09-06 19:35:43','2006-09-06 19:35:43','DataConcept',1,1),(6,2,'Sample',1,'Sample',NULL,1,'2006-09-06 19:35:50','2006-09-06 19:35:51','DataConcept',1,1),(7,2,'Container',1,'Container',NULL,2,'2006-09-06 19:36:00','2007-01-19 15:37:11','DataConcept',1,1),(8,7,'Plate',1,'Plate',NULL,1,'2006-09-06 19:36:07','2006-09-06 19:36:07','DataConcept',1,1),(9,7,'Rack',1,'Rack',NULL,1,'2006-09-06 19:36:13','2006-09-06 19:36:13','DataConcept',1,1),(10,7,'Tube',1,'Tube',NULL,1,'2006-09-06 19:36:24','2006-09-06 19:36:24','DataConcept',1,1),(11,7,'Tray',1,'Tray',NULL,2,'2006-09-06 19:36:32','2006-09-06 19:39:47','DataConcept',1,1),(24,1,'Experiment',1,'Experiment main element in the execution of a workflow',NULL,1,'2006-11-22 12:49:19','2006-12-05 18:15:43','DataConcept',1,1),(25,1,'Protocol',1,'Protocol',NULL,0,'2006-11-22 12:52:00','2006-11-22 12:52:00','DataConcept',1,1),(26,1,'Unit',1,'Unit',NULL,0,'2006-11-22 12:52:30','2006-11-22 12:52:30','DataConcept',1,1),(27,1,'Task',1,'Task',NULL,0,'2006-11-22 12:53:17','2006-11-22 12:53:17','DataConcept',1,1),(28,1,'DataType',1,'Various type of data the system is expected to handle like numeric ,text',NULL,3,'2006-11-22 12:53:47','2007-01-22 23:32:32','DataConcept',1,1),(29,1,'DataFormat',1,'Data Formats are skill',NULL,1,'2006-11-22 12:56:05','2007-01-12 13:58:05','DataConcept',1,1),(30,1,'ParameterType',1,'ParameterType',NULL,0,'2006-11-22 12:56:57','2006-11-22 12:56:57','DataConcept',1,1),(31,1,'ParameterRole',1,'Parameter Role',NULL,0,'2006-11-22 12:57:18','2006-11-22 12:57:18','DataConcept',1,1),(33,1,'Times',1,'Timed Measurements',NULL,0,'2006-12-12 13:53:02','2006-12-12 13:53:02','DataConcept',1,1),(39,1,'Lookup',1,'Lookup',NULL,0,'2007-01-19 16:04:03','2007-01-19 16:04:03','DataConcept',1,1),(47,39,'Species',0,'Mammals licensed by company for pre-clinical safety studies',NULL,3,'2007-01-31 13:51:33','2007-03-20 15:57:04','DataConcept',1,1),(48,1,'Users',0,'Allowed Username for people in the system',NULL,1,'2007-02-28 17:55:48','2007-02-28 17:55:48','DataConcept',1,1),(49,39,'Flags',0,'Flags used for compound progression, quality control etc',NULL,1,'2007-03-20 15:53:10','2007-03-20 15:53:10','DataConcept',1,1),(50,2,'Target',0,'A biological target are the subject of drug discovery campaigns and typically include newly discovered proteins.',NULL,1,'2007-04-03 16:44:25','2007-04-03 16:44:25','DataConcept',1,1);
