INSERT INTO `data_formats` VALUES (1,'Text','Free Format Text','','.',1,'0000-00-00 00:00:00','2007-02-07 14:10:25',1,1,1),(2,'Alpha','A-Z',NULL,NULL,0,'0000-00-00 00:00:00','0000-00-00 00:00:00',1,1,1),(3,'Line','Single Line of Text',NULL,'/[^\"\\r\\n]*/',0,'0000-00-00 00:00:00','0000-00-00 00:00:00',1,1,1),(4,'Double','Standard Number format +/-nnn.nnnnn','0.0','^[-+]?[0-9]*\\.?[0-9]+$',2,'2006-11-27 11:59:22','2007-02-07 21:42:48',2,1,1),(5,'Hex','Nex values',NULL,'/\\b0[xX][0-9a-fA-F]+\\b/',0,'0000-00-00 00:00:00','0000-00-00 00:00:00',1,1,1),(6,'Float','Floating Point number',NULL,'/((\\b[0-9]+)?\\.)?[0-9]+\\b/',0,'0000-00-00 00:00:00','0000-00-00 00:00:00',2,1,1),(7,'Scientific Notation','Scientific Notation',NULL,'/[-+]?[0-9]*\\.?[0-9]+([eE][-+]?[0-9]+)?/',0,'0000-00-00 00:00:00','0000-00-00 00:00:00',2,1,1),(8,'Integer','Integer Value','','[-+]?\\b\\d+\\b',1,'0000-00-00 00:00:00','2007-02-07 14:10:37',2,1,1),(9,'Email','Email Address',NULL,'/^[A-Z0-9._%-]+@[A-Z0-9.-]+\\.[A-Z]{2,4}$/',0,'0000-00-00 00:00:00','0000-00-00 00:00:00',1,1,1),(10,'Date','Date yyyy-mm-dd',NULL,'/(19|20)\\d\\d[- /.](0[1-9]|1[012])[- /.](0[1-9]|[12][0-9]|3[01])/',0,'0000-00-00 00:00:00','0000-00-00 00:00:00',3,1,1),(11,'Positive','Description:  	Positive integer value.\r\nMatches: 	123|||10|||54\r\nNon-Matches: 	-54|||54.234|||abc',NULL,'/^d$/',0,'0000-00-00 00:00:00','0000-00-00 00:00:00',2,1,1),(12,'Decimal5.2','Description:  	validates to 5 digits and 2 decimal places but not allowing zero\r\nMatches: 	12345.12|||0.5\r\nNon-Matches: 	123456.12|||1.234|||.1',NULL,'/(?!^0*$)(?!^0*\\.0*$)^\\d{1,5}(\\.\\d{1,2})?$/',0,'0000-00-00 00:00:00','0000-00-00 00:00:00',2,1,1),(13,'Percentage','Description:  	Percentage (From 0 to 100)\r\nMatches: 	100%|||100|||52.65%\r\nNon-Matches: 	-1|||-1%|||100.1%',NULL,'/(0*100{1,1}\\.?((?<=\\.)0*)?%?$)|(^0*\\d{0,2}\\.?((?<=\\.)\\d*)?%?)$/',0,'0000-00-00 00:00:00','0000-00-00 00:00:00',2,1,1),(14,'Dollars','Description:  	Regular expression for validating a US currency string field. Matches an unlimited number of digits to the left of an optional decimal point. Digits to the left of the decimal point can optionally be formatted with commas, in standard US currency format. If the decimal point is present, it must be followed by exactly two digits to the right. Matches an optional preceding dollar sign. Uses regex lookahead to preclude leading zeros and to match the optional formatting comma.\r\nMatches: 	$3,023,123.34|||9,876|||123456.78\r\nNon-Matches: 	0.002|||$01.00|||###1.00',NULL,'(?n:(^\\$?(?!0,?\\d)\\d{1,3}(?=(?<1>,)|(?<1>))(\\k<1>\\d{3})*(\\.\\d\\d)?)$)',0,'0000-00-00 00:00:00','0000-00-00 00:00:00',2,1,1),(15,'SSN','Description:  	This regular expression will match a hyphen-separated Social Security Number (SSN) in the format NNN-NN-NNNN.\r\nMatches: 	333-22-4444|||123-45-6789\r\nNon-Matches: 	123456789|||SSN',NULL,'/^\\d{3}-\\d{2}-\\d{4}$/',0,'0000-00-00 00:00:00','0000-00-00 00:00:00',1,1,1),(16,'CreditCard','Description:  	Updated on 7 Jun 2005 -- Matches major credit cards including: Visa (length 16, prefix 4); Mastercard (length 16, prefix 51-55); Diners Club/Carte Blanche (length 14, prefix 36, 38, or 300-305); Discover (length 16, prefix 6011); American Express (length 15, prefix 34 or 37). Saves the card type as a named group to facilitate further validation against a &quot;card type&quot; checkbox in a program. All 16 digit formats are grouped 4-4-4-4 with an optional hyphen or space between each group of 4 digits. The American Express format is grouped 4-6-5 with an optional hyphen or space between each group of digits. Formatting characters must be consistant, i.e. if two groups are separated by a hyphen, all groups must be separated by a hyphen for a match to occur.\r\nMatches: 	4111-2222-3333-4444|||3411 222222 33333|||5111222233334444\r\nNon-Matches: 	4111-2222-3333-444|||3411-2222-3333-4444|||Visa',NULL,'/^(?:(?<Visa>4\\d{3})|(?<Mastercard>5[1-5]\\d{2})|(?<Discover>6011)|(?<DinersClub>(?:3[68]\\d{2})|(?:30[0-5]\\d))|(?<AmericanExpress>3[47]\\d{2}))([ -]?)(?(DinersClub)(?:\\d{6}\\1\\d{4})|(?(AmericanExpress)(?:\\d{6}\\1\\d{5})|(?:\\d{4}\\1\\d{4}\\1\\d{4})))$/',0,'0000-00-00 00:00:00','0000-00-00 00:00:00',1,1,1),(17,'FullName','Description:  	Regular expression for validating a person\'s full name. Matches on two general formats: 1) first second third last (where first, second, and third names are optional and all present are separated by a space); 2) last, first second third (where second and third are optional, last is followed immediately by a comma and a space, and second, and third, if present, are separated by a space from each other and from first). First corresponds to surname and last corresponds to family name. Each name part is captured to a named group to facilitate program manipulation. Each name part must begin with an uppercase letter, followed by zero or more lowercase letters, except for the last name. Last name must begin with an uppercase letter, followed by one or more lowercase letters, but will match exceptions formatted like the following: McD..., MacD..., O\'R... Only format is validated, not spelling. NOTE: This regular expression uses positive and negative regex lookahead to determine the general format of the name, i.e. the presence or the absence of the comma determines the general format that will match. Furthermore, this initial version is not designed to accommodate titles and things like &quot;3rd&quot;.\r\nMatches: 	John Paul Jones|||Jones, John P|||Jones\r\nNon-Matches: 	Paul Jones, John|||John J|||Mr. John Paul Jones 3rd',NULL,'(?n:(^(?(?![^,]+?,)((?<first>[A-Z][a-z]*?) )?((?<second>[A-Z][a-z]*?) )?((?<third>[A-Z][a-z]*?) )?)(?<last>[A-Z]((\'|[a-z]{1,2})[A-Z])?[a-z]+))(?(?=,)(, (?<first>[A-Z][a-z]*?))?( (?<second>[A-Z][a-z]*?))?( (?<third>[A-Z][a-z]*?))?)$)',0,'0000-00-00 00:00:00','0000-00-00 00:00:00',1,1,1),(18,'DayTime','Description:  	Matches a string if it is a valid time in the format of HH:MM\r\nMatches: 	02:04|||16:56|||23:59\r\nNon-Matches: 	02:00 PM|||PM2:00|||24:00\r\n ',NULL,'/^([0-1][0-9]|[2][0-3]):([0-5][0-9])$/',0,'0000-00-00 00:00:00','0000-00-00 00:00:00',4,1,1),(19,'EngDate','Description:  	valid date base on Month\r\nMatches: 	01 Jan 2003\r\nNon-Matches: 	01 01 2003\r\n ',NULL,'/^\\d{2}\\s{1}(Jan|Feb|Mar|Apr|May|Jun|Jul|Apr|Sep|Oct|Nov|Dec)\\s{1}\\d{4}$/',0,'0000-00-00 00:00:00','0000-00-00 00:00:00',3,1,1),(20,'Time','Description:  	Validates Microsoft Project-type duration entries. Accepts a number and a unit. The number part can be integer or decimal. The unit can be several variations of weeks, days, and hours: e.g., w, wk, week, ws, wks, weeks are all valid. Whitespace between the number and the unit is optional: e.g., 1d, 2 days, 3.5w are all valid. Captures the number value in a group named num and the unit string in a group named \'unit\'.\r\nMatches: 	1 day|||3.5 w|||6hrs\r\nNon-Matches: 	1|||6. days|||1 week 2 d',NULL,'^\\s*(?\'num\'\\d+(\\.\\d+)?)\\s*(?\'unit\'((w(eek)?)|(wk)|(d(ay)?)|(h(our)?)|(hr))s?)(\\s*$)',0,'0000-00-00 00:00:00','0000-00-00 00:00:00',4,1,1),(21,'US-Phone','Description:  	US Phone Number: This regular expression for US phone numbers conforms to NANP A-digit and D-digit requirments (ANN-DNN-NNNN). Area Codes 001-199 are not permitted; Central Office Codes 001-199 are not permitted. Format validation accepts 10-digits without delimiters, optional parens on area code, and optional spaces or dashes between area code, central office code and station code. Acceptable formats include 2225551212, 222 555 1212, 222-555-1212, (222) 555 1212, (222) 555-1212, etc. You can add/remove formatting options to meet your needs.\r\nMatches: 	5305551212|||(530) 555-1212|||530-555-1212\r\nNon-Matches: 	0010011212|||1991991212|||123) not-good',NULL,'/^(?:\\([2-9]\\d{2}\\)\\ ?|[2-9]\\d{2}(?:\\-?|\\ ?))[2-9]\\d{2}[- ]?\\d{4}$/',0,'0000-00-00 00:00:00','0000-00-00 00:00:00',1,1,1),(22,'IP-Address','Description:  	RegExp for validating the format of IP Addresses. This works great with the ASP.NET RegularExpressionValidator server control.\r\nMatches: 	127.0.0.1|||255.255.255.0|||192.168.0.1\r\nNon-Matches: 	1200.5.4.3|||abc.def.ghi.jkl|||255.foo.bar.1\r\n ',NULL,'/^(25[0-5]|2[0-4][0-9]|[0-1]{1}[0-9]{2}|[1-9]{1}[0-9]{1}|[1-9])\\.(25[0-5]|2[0-4][0-9]|[0-1]{1}[0-9]{2}|[1-9]{1}[0-9]{1}|[1-9]|0)\\.(25[0-5]|2[0-4][0-9]|[0-1]{1}[0-9]{2}|[1-9]{1}[0-9]{1}|[1-9]|0)\\.(25[0-5]|2[0-4][0-9]|[0-1]{1}[0-9]{2}|[1-9]{1}[0-9]{1}|[0-9]',0,'0000-00-00 00:00:00','0000-00-00 00:00:00',1,1,1),(23,'URL-UK','Description:  	UK http/https/ftp URI. Based on my previous expression, this one takes an optional port number and optional trailing slash.\r\nMatches: 	http://www.zeropanic.co.uk/|||http://www.zeropanic.co.uk:81/|||http://www.zeropanic.co.uk:81\r\nNon-Matches: 	http://www.zeropanic.com:81/\r\n ',NULL,'/^(ht|f)tp((?<=http)s)?://((?<=http://)www|(?<=https://)www|(?<=ftp://)ftp)\\.(([a-z][0-9])|([0-9][a-z])|([a-z0-9][a-z0-9\\-]{1,2}[a-z0-9])|([a-z0-9][a-z0-9\\-](([a-z0-9\\-][a-z0-9])|([a-z0-9][a-z0-9\\-]))[a-z0-9\\-]*[a-z0-9]))\\.(co|me|org|ltd|plc|net|sch|ac|mo',0,'0000-00-00 00:00:00','0000-00-00 00:00:00',NULL,1,1),(24,'URL','Description:  	I wrote this after I couldn\'t find an expression that would search for valid URLs, whether they had HTTP in front or not. This will find those that don\'t have hyphens anywhere in them (except for after the domain).\r\nMatches: 	http://www.google.com|||www.123google.com|||www.google.com/help/me\r\nNon-Matches: 	-123google.com|||http://-123.123google.com\r\n ',NULL,'/^(?<link>((?<prot>http:\\/\\/)*(?<subdomain>(www|[^\\-\\n]*)*)(\\.)*(?<domain>[^\\-\\n]+)\\.(?<after>[a-zA-Z]{2,3}[^>\\n]*)))$/',0,'0000-00-00 00:00:00','0000-00-00 00:00:00',6,1,1);
