'2007-04-25 11:40:54',3,3,NULL,13),(14,NULL,NULL,12,'image/jpeg','4.Hyperexcitation_normal.jpg','normal',199945,267,200,0,0,NULL,0,'2007-04-25 11:40:54','2007-04-25 11:40:54',3,3,NULL,14),(15,NULL,'Pain inflammatory mediators_sm',NULL,'image/jpeg','2.Pain_inflammatory_mediators_sm.jpg',NULL,52802,200,150,0,0,NULL,0,'2007-04-25 11:52:28','2007-04-25 11:52:28',3,3,NULL,18),(16,NULL,NULL,15,'image/jpeg','2.Pain_inflammatory_mediators_sm_icon.jpg','icon',53704,48,36,0,0,NULL,0,'2007-04-25 11:52:28','2007-04-25 11:52:28',3,3,NULL,16),(17,NULL,NULL,15,'image/jpeg','2.Pain_inflammatory_mediators_sm_normal.jpg','normal',53704,267,200,0,0,NULL,0,'2007-04-25 11:52:28','2007-04-25 11:52:28',3,3,NULL,17);
