INSERT INTO `project_contents` VALUES (19,4,NULL,'Sop-7','SOP',NULL,'<h2><span class=\"mw-headline\">Cell proliferation</span></h2> <p>Proliferation assays are based on direct cell counting, thymidine incorporation or staining techniques for <a href=\"http://en.wikipedia.org/wiki/Cell_growth\" title=\"Cell growth\">cell proliferation</a> or death and takes advantage of the proliferation of <a href=\"http://en.wikipedia.org/wiki/Endothelial_cells\" title=\"Endothelial cells\">endothelial cells</a> after stimulation with <a href=\"http://en.wikipedia.org/wiki/Cytokine\" title=\"Cytokine\">cytokines</a>. The source of endothelial cells may influence the outcome of tests validating angiogenic activity, as endothelial cells originating from large vessels differ from endothelial cells from microvasculature, and endothelial cells from different organs may have distinct properties. Another aspect to consider is that endothelial cells used in laboratory assays are in a <a href=\"http://en.wikipedia.org/wiki/Wound_healing\" title=\"Wound healing\">proliferative phase</a>, compared to endothelial cells in a mature resting vessel in a steady state with low levels of cell proliferation and migration.</p> <p><a id=\"Endothelial_cell_migration\" name=\"Endothelial_cell_migration\" title=\"Endothelial_cell_migration\"></a></p> <h2><span class=\"editsection\">[<a href=\"http://en.wikipedia.org/w/index.php?title=Angiogenesis_assays&amp;action=edit&amp;section=2\" title=\"Edit section: Endothelial cell migration\">edit</a>]</span> <span class=\"mw-headline\">Endothelial cell migration</span></h2> <p>Migration assays are based on the ability of endothelial cells to migrate in response to chemotactic stimuli. Most assays use different variants of the Boyden chamber, in which two compartments are separated by a filter membrane with a pore size that allows endothelial cells to pass by active migration. When endothelial cells are added to the top well, chemotactic solutions are placed in the lower well and cells that have migrated toward the chemotactic stimulus are counted after a period of incubation. The migrated cells on the other side of the membrane can be counted manually.</p> <p><a id=\"Cell_matrix_interactions\" name=\"Cell_matrix_interactions\" title=\"Cell_matrix_interactions\"></a></p> <h2><span class=\"editsection\">[<a href=\"http://en.wikipedia.org/w/index.php?title=Angiogenesis_assays&amp;action=edit&amp;section=3\" title=\"Edit section: Cell matrix interactions\">edit</a>]</span> <span class=\"mw-headline\">Cell matrix interactions</span></h2> <p>The most commonly used assay to study cell-matrix interactions is the cell adhesion assay. Adhesion of endothelial cels to <a href=\"http://en.wikipedia.org/wiki/Extracellular_matrix\" title=\"Extracellular matrix\">extracellular matrix</a> proteins, such as collagen IV, laminin, vitronectin, and fibronectin, is mediated by various surface receptors belonging to several families, such as integrins and cell surface proteoglycans. Interactions between matrix proteins and endothelial cells play important roles in cell survival, proliferation and migration.</p> <p><a id=\"Tube_formation\" name=\"Tube_formation\" title=\"Tube_formation\"></a></p> <h2><span class=\"editsection\">[<a href=\"http://en.wikipedia.org/w/index.php?title=Angiogenesis_assays&amp;action=edit&amp;section=4\" title=\"Edit section: Tube formation\">edit</a>]</span> <span class=\"mw-headline\">Tube formation</span></h2> <p>Another approach is to study the formation of <a href=\"http://en.wikipedia.org/wiki/Capillary\" title=\"Capillary\">capillary</a>-like tubes when endothelial cells are cultured on Matrigel, a mixture of extracellular and <a href=\"http://en.wikipedia.org/wiki/Basal_lamina\" title=\"Basal lamina\">basement membrane</a> proteins, particularly laminin, prepared from Engelbreth-Holm-Swarm (EHS) mouse tumors. Tube formation during angiogenesis involves complex cell-cell and cell-matrix interactions. This method is fast, but it is not clear if the &ldquo;tubules&rdquo; really possess a lumen. It is reported that cells of non-endothelial origin, such as <a href=\"http://en.wikipedia.org/wiki/Fibroblast\" title=\"Fibroblast\">fibroblasts</a>, can form tubule-like strands on Matrigel. Results from this assay should therefore be interpreted with great caution.</p>',NULL,0,0,0,NULL,NULL,NULL,1,'2007-04-20 12:53:11','2007-04-20 12:53:30',1,1),(20,4,NULL,'ps-1','Peripheral senstization',NULL,'<p><font face=\"Verdana, Arial, Helvetica, sans-serif\" size=\"2\">Bradykinin                          stimulates further synthesis/release of prostaglandins,                          and, together with the prostaglandins, sensitizes the                          primary afferent sensory fibers in response to stimulation                          by ATP, acetylcholine, serotonin and mechanical and thermal                          stimuli <font size=\"-2\">1,2,3</font></font></p><p><font face=\"Verdana, Arial, Helvetica, sans-serif\" size=\"2\">Substance                          P and CGRP released by the primary afferent sensory fibers                          contribute to the pain response by triggering the release                          of histamine from mast cells which, in turn, excites the                          peripheral afferent sensory fibers <font size=\"-2\">1,2,3</font></font></p><p><font face=\"Verdana, Arial, Helvetica, sans-serif\" size=\"2\">&quot;                          Sensitization of the primary afferent sensory fibers by                          mediators of the pain response results in greater, more                          frequent transmission of action potentials to the nociceptive                          neurons than in &#39;normal&#39; pain responses <font size=\"-2\">1,2,5                          </font></font></p>',NULL,0,0,0,NULL,NULL,NULL,1,'2007-04-25 11:45:45','2007-04-25 11:49:53',3,3),(21,4,NULL,'Hyper.1','Hyperexitation',NULL,'<p><font face=\"Verdana, Arial, Helvetica, sans-serif\" size=\"2\">                          Hyperalgesia: Certain noxious stimuli (e.g. severe bruising)                          can result in the individual perceiving abnormally high                          levels of pain in response to normal noxious stimuli such                          as a small scratch; in such cases, patients often perceive                          spontaneous pain <font size=\"-2\">1,2,4</font></font></p><p>&nbsp;<font face=\"Verdana, Arial, Helvetica, sans-serif\" size=\"2\"><strong>References:</strong></font></p>               <p><font face=\"Verdana, Arial, Helvetica, sans-serif\" size=\"2\">1.                  Kandel ER, Schwartz JH, Jessell TM, editors. Principles of Neural                  Science (Fourth Edition). New York: McGraw Hill (Health Professions                  Division). 2000;472-491. </font></p>               <p><font face=\"Verdana, Arial, Helvetica, sans-serif\" size=\"2\">2.                  Millan MJ. Progress in Neurobiology 1999;57:1-164. </font></p>               <p><font face=\"Verdana, Arial, Helvetica, sans-serif\" size=\"2\">3.                  Dickenson AH. Brit J Anaesthesia 1995;75:193-200. </font></p>               <p><font face=\"Verdana, Arial, Helvetica, sans-serif\" size=\"2\">4.                  Suzuki R and Dickenson AH. Neuroreport 2000;11:R17-21. </font></p>               <p><font face=\"Verdana, Arial, Helvetica, sans-serif\" size=\"2\">5.                  Waxman S. Pain 1999;6:S133-140. </font></p><p>&nbsp;</p>',NULL,0,0,0,NULL,NULL,NULL,5,'2007-04-25 11:46:15','2007-04-25 20:45:21',3,3),(22,4,NULL,'pain-1','Nociceptive pain',NULL,'<?xml version=\"1.0\" encoding=\"utf-8\"?> <!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\" \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\"> <html xmlns=\"http://www.w3.org/1999/xhtml\" lang=\"en\" xml:lang=\"en\"> <head> 	<title>Untitled document</title> 	<meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\" /> </head> <body> <font face=\"Verdana, Arial, Helvetica, sans-serif\"><strong><font size=\"2\">Allodynia</font></strong></font>                     <ul><li><font face=\"Verdana, Arial, Helvetica, sans-serif\" size=\"2\">                          Tissue injury often results in nociceptive pain, in which                          persistent pain is felt in response to direct activation                          of peripheral nerve terminals in the skin by pain response                          mediators from the damaged tissue<font size=\"-2\"> 1,2                          </font></font></li><li><font face=\"Verdana, Arial, Helvetica, sans-serif\" size=\"2\">                          Nociceptive pain: Following tissue injury, Substance P,                          CGRP and glutamate are released by peripheral afferent                          sensory fibers and act on peptide and glutamate receptors                          on the post-synaptic membrane to cause greater excitability                          of nociceptive neurons. Nociceptive neurons become hyperexcitable,                          resulting in central sensitization and thus greater perception                          of pain in the higher centers <font size=\"-2\">1,2,3</font></font></li><li><font face=\"Verdana, Arial, Helvetica, sans-serif\" size=\"2\">                          Nociceptive pain may involve the abnormal pain states                          of allodynia or hyperalgesia which result from both peripheral                          and central hypersensitivity <font size=\"-2\">1,2,3</font></font></li><li><font face=\"Verdana, Arial, Helvetica, sans-serif\" size=\"2\">                          Allodynia: Certain types of noxious stimulus (e.g. sunburn,                          injury, post-surgical wounds) may result in the individual                          perceiving pain in response to stimuli that are not normally                          painful, such as a light stroking of the skin<font size=\"-3\">                          1,2,4 </font></font></li></ul> </body> </html>',NULL,0,0,0,NULL,NULL,NULL,2,'2007-04-25 11:47:04','2007-04-25 21:16:34',3,3),(23,4,NULL,'pain-2','Nueropathic Pain',NULL,'<font face=\"Verdana, Arial, Helvetica, sans-serif\" size=\"2\">Neuropathic                          pain occurs following direct injury to the nerves in the                          peripheral or central nervous systems. Neuropathic pain                          can result from complete or partial nerve transection,                          nerve compression, infiltration or infectious/inflammatory/ischemic                          etiologies <font size=\"-2\">1,2,4</font></font>                          <font face=\"Verdana, Arial, Helvetica, sans-serif\" size=\"2\">                              Partial severance of peripheral afferent sensory fibers                              results in neuropathic pain in the form of ectopic                              activity</font>',NULL,0,0,0,NULL,NULL,NULL,1,'2007-04-25 11:47:39','2007-04-25 11:54:23',3,3),(24,4,NULL,'paf-1','Repeated firing of PAF\'s',NULL,'<font face=\"Verdana, Arial, Helvetica, sans-serif\" size=\"2\">During                          wind up, the peripheral afferent sensory fibers fire repeatedly,                          there is increased transmitter release into the spinal                          cord, and the response by spinal cord neurons increases                          progressively <font size=\"-2\">1,3,4</font></font>',NULL,0,0,0,NULL,NULL,NULL,0,'2007-04-25 11:48:23','2007-04-25 11:48:23',3,3),(25,4,NULL,'ion-1','Ion channels',NULL,'<font face=\"Verdana, Arial, Helvetica, sans-serif\" size=\"2\">In                          the synapse, repeated firing from peripheral afferent                          sensory fibers and consequent release of glutamate results                          in the prolonged opening of post-synaptic ion channels                          gated by N-methyl-D-aspartate (NMDA)-type glutamate receptors                          <font size=\"-2\">1,2,3</font></font>',NULL,0,0,0,NULL,NULL,NULL,1,'2007-04-25 11:48:55','2007-04-25 11:53:43',3,3),(26,4,NULL,'pain-0','Pain inflammatory mediators',NULL,'<ul><li><font face=\"Verdana, Arial, Helvetica, sans-serif\" size=\"2\">	                         Tissue injury causes the release of various inflammatory                          and pain mediators resulting in peripheral sensitization<font size=\"-2\">                          1,2,3</font></font></li><li><font face=\"Verdana, Arial, Helvetica, sans-serif\" size=\"2\">                          Pain response mediators: ATP, acetylcholine and serotonin                          are released from damaged endothelial cells and platelets;                          prostaglandin E2 is synthesized by Cyclooxygenase I and                          II enzymes in damaged cells; bradykinin is released from                          plasma from damaged vessels<font size=\"-2\"> 1,2</font></font></li><li><font face=\"Verdana, Arial, Helvetica, sans-serif\" size=\"2\">                          Inflammatory response mediators: Histamine is released                          from mast cells in response to Substance P and calcitonin                          gene-related peptide (CGRP) released by primary afferent                          sensory fibers; additional mediators are released from                          blood cells (cytokines, complement factors C3a and C5a,                          serotonin, platelet-activating factor, neutrophil chemotactic                          factor, fibrinopeptides, leukotrienes)<font size=\"-2\">                          1,2</font></font></li><li><font face=\"Verdana, Arial, Helvetica, sans-serif\" size=\"2\">                          Together with bradykinin and prostaglandins, these inflammatory                          mediators cause peripheral vasodilation, increased vascular                          permeability, plasma extravasation, migration of leucocytes                          to the site of injury, and clotting responses<font size=\"-2\">                          1</font> </font></li></ul>',NULL,0,0,0,NULL,NULL,NULL,1,'2007-04-25 11:51:59','2007-04-25 11:53:00',3,3),(27,4,NULL,'ProjectContent-16','test tags',NULL,'tests',NULL,0,0,0,NULL,NULL,NULL,0,'2007-04-25 13:39:46','2007-04-25 13:39:46',3,3),(28,4,NULL,'rshell-22','List_of_Study',NULL,'<div class=\"report\">\n<table class=\"report\" width=\'100%\'>\n\n<thead class=\'header_report_5\'>\n  <tr>\n    \n    <th>\n         Id\n    </th>\n    \n    <th>\n         Name\n    </th>\n    \n    <th>\n         Description\n    </th>\n    \n    <th>\n         Research_area\n    </th>\n    \n    <th>\n         Purpose\n    </th>\n    \n  </tr>\n</thead>  \n\n<tbody id=\'body_report_5\'>  \n\n   \n          \n   \n   \n       <tr   > \n                \n                \n                <td >\n                  1.000                \n                </td>\n         \n                \n                <td >\n                  Biomarker And Histology                \n                </td>\n         \n                \n                <td >\n                  A synchronous study covering multiple groups using different techniques and employing request fulfillment to progress the animals under investigation through the three tiers of testing: weight monitoring, taqman analysis and histological analysis.                \n                </td>\n         \n                \n                <td >\n                  in-vivo                \n                </td>\n         \n                \n                <td >\n                  RF                \n                </td>\n         \n      </tr>\n      \n\n   \n          \n   \n   \n       <tr class=\"even\"  > \n                \n                \n                <td >\n                  2.000                \n                </td>\n         \n                \n  